import React, { Component } from 'react'

export default class WorkingWithClasses extends Component {
  render() {
    const { nameClass, typeClass } = this.props
    return (
      <div>
        <input value="O nome da classe é {nameClass} e o tipo da classe é {typeClass}"/>
      </div>
    )
  }
}
